import { Avatar, Divider, Grid, List, TextField } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
   
          <div style={{marginTop:'30px'}}>
    <Avatar src={nikklaus} />       
    <input  type="text" placeholder="What's on your mind dawg?"/>

   
    </div>

     );
}
 
export default Posts;
